	UPDATE register_user SET is_window_app = active_status,
    window_app_active_date = UTC_TIMESTAMP()
    WHERE register_user_id = user_id;
ELSE
	UPDATE register_user SET is_window_app = active_status,
    window_app_deactivate_date = UTC_TIMESTAMP()
    WHERE register_user_id = user_id;
END IF;	
END$$

